    String checkResult=IPUtil.checkIPs(ipArray);
    if (IPUtil.checkOK(checkResult)) {
      List<Instance> instanceList=addressServerGeneratorManager.generateInstancesByIps(serviceName,rawProductName,clusterName,ipArray);
